INSERT INTO `v1_54891f294824e1c412d19d0664fafe3448004fd9a8b00a001612aaf3f38335b7` VALUES (76030005, 603000502, "すべてのモンスターが一度の行動で受けるダメージ値を減衰させる。ダメージ値が上昇するほど減衰率も上昇する。", "ダメージ減衰", 18);
